import logo from './logo.svg';
import './App.css';

const Header= () => {
return (
<h1>Hello! Just testing header!</h1>
);
};

const Home = () => {
  return (
    <h1>Hello! Just testing home!</h1>
    );
};
const Products = () => {
  return (
    <h1>Hello! Just testing products!</h1>
    );
};
const Company = () => {
  return (
    <h1>Hello! Just testing company!</h1>
    );
};

function App() {
  return (<div>
    <Header />
    <Switch>
      <Route exact path="/">
        <Home />
      </Route>
      <Route path="/products">
        <Products/>
      </Route>
      <Route path="/company">
        <Company />
      </Route>
    </Switch>
  </div>

  );
}

export default App;
